                        item.UnsetObjectBoundsMax();
                    }
                    return TryGet<Worldspace_FieldIndex?>.Succeed(Worldspace_FieldIndex.ObjectBoundsMax);
                case "SNAM":
                    frame.Position += Constants.SUBRECORD_LENGTH;
                    var MusictryGet = Mutagen.Bethesda.Binary.EnumBinaryTranslation<MusicType>.Instance.Parse(
                        frame.SpawnWithLength(contentLength),
                        fieldIndex: (int)Worldspace_FieldIndex.Music,
                        errorMask: errorMask);
                    if (MusictryGet.Succeeded)
                    {
                        item.SetMusic(item: MusictryGet.Value);
                    }
                    else
                    {
                        item.UnsetMusic();
                    }
                    return TryGet<Worldspace_FieldIndex?>.Succeed(Worldspace_FieldIndex.Music);
                case "XXXX":
                    try
                    {
                        using (var subFrame = frame.SpawnWithLength(Constants.SUBRECORD_LENGTH + contentLength, snapToFinalPosition: false))
                        {
                            FillBinary_OffsetLength_Custom(
                                frame: subFrame,
                                item: item,
                                errorMask: errorMask);
                        }
                    }
                    catch (Exception ex)
                    when (errorMask != null)
                    {
                        errorMask().Overall = ex;
                    }
                    return TryGet<Worldspace_FieldIndex?>.Succeed(null);
                case "OFST":
                    try
                    {
                        using (var subFrame = frame.SpawnWithLength(Constants.SUBRECORD_LENGTH + contentLength, snapToFinalPosition: false))
                        {
                            FillBinary_OffsetData_Custom(
                                frame: subFrame,
                                item: item,
                                fieldIndex: (int)Worldspace_FieldIndex.OffsetData,
                                errorMask: errorMask);
                        }
                    }
                    catch (Exception ex)
                    when (errorMask != null)
                    {
                        errorMask().Overall = ex;
                    }
                    return TryGet<Worldspace_FieldIndex?>.Succeed(Worldspace_FieldIndex.OffsetData);
                default:
                    return NamedMajorRecord.Fill_Binary_RecordTypes(
                        item: item,
                        frame: frame,
                        recordTypeConverter: recordTypeConverter,
                        errorMask: errorMask).Bubble((i) => WorldspaceCommon.ConvertFieldIndex(i));
            }
        }

